import TodoItem from "../TodoItem"

const TodoList = ({todos, toggleComplite, deleteTodo}) => {
    return <div>
        {todos.forEach(element => {
            <TodoItem todo = {element} toggleComplite={toggleComplite} deleteTodo = {deleteTodo} />
        })}
    </div>
}

export default TodoList;
